import Home from "./pages/Home/Home";

import Logement from './pages/Home/logement/Logement';
import APropos from './APropos/APropos';
import Notfound from './notfound/Notfound';
import AProposOpen from './AproposOpen/AproposOpen';
import ComposantsDesktop from './ComposantsDesktop/ComposantsDesktop';

const routes = [
  { path: '/', element: <Home /> },
  { path: '/logement', element: <Logement /> },
  { path: '/ComposantsDesktop', element: <ComposantsDesktop /> },
  { path: '/APropos', element: <APropos /> },
  { path: '/AproposOpen', element: <AProposOpen /> },
  { path: '*', element: <Notfound /> }
];

export default routes;
